window.bookSummaryJSON = "<p>The near future. A UFO appears on Earth's orbit. Ignoring all contact attempts, it showers the planet with priceless artifacts. Choose: perfect health, $10 million, or seven years in prison, per the new amendment. </p><p>The night of the meteor shower, Paul and his friends run around the city, engaging in quick fights with citizens gone crazy, trying to obtain one of the artifacts. </p><p>But is it really selfless help the mysterious aliens are offering? What awaits a human who holds a precious crystal in his hand? Where will he wake up tomorrow? What if the first thing he sees when he opens his eyes is the blinking line of text \"Loading location: virtual training ground Kubinka-Digital. Welcome, cadet! You're now space fighter pilot!\"? </p>"; 
